.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: rgba(120, 132, 143, 0.7375);
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid transparent;
  background-color: #1D252C;
}
.github-tab-icon {
  color: rgba(59, 68, 76, 0.8845);
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: rgba(37, 45, 52, 0.87);
  border-radius: 0.125rem;
  padding: 0 .25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: rgba(255, 255, 255, 0.8);
  box-shadow: 0 1px 0 #1D252C;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: rgba(183, 197, 211, 0.65);
}
